import React from "react";
import { TFilter, TFilterConfig } from "../types";

type FiltersProps = {
  filterConfig: TFilterConfig;
};

export default function Filters({ filterConfig }: FiltersProps) {
  // Update filter functions
  const handleCompleted = (value) => {
    if (filterConfig) {
      return value;
    }
  };
  const handleNotCompleted = (value) => {
    if (filterConfig) {
      return value;
    }
  };

  return (
    <div>
      <h1>Filters</h1>
      <div>
        <h2>Completed</h2>
        <label>
          <input
            type="checkbox"
            onChange={handleCompleted(event?.target.valueOf())}
          />
          <span>Completed</span>
        </label>
        <label>
          <input type="checkbox" onChange={handleNotCompleted(event?.target)} />
          <span>Not Completed</span>
        </label>
      </div>
    </div>
  );
}
